export default {
    name: 'dialogSetTime',
    props: ['title'],
    data () {
        return {
            formData: {
                technicalBidDeadline: null,
                quotationDeadline: null,
                technicalBidOpeningTime: null,
                businessOpeningTime: null
            },
            dialogVisible: false,
            rules: {
                technicalBidDeadline: [
                    { required: true, message: '请选择', trigger: 'blur' }
                ]
            },
            formConfig: [
                { type: 'date', label: '技术投标止', prop: 'technicalBidDeadline', width: '' },
                { type: 'date', label: '报价截止', prop: 'quotationDeadline', width: '' },
                { type: 'datetime', label: '技术开标', prop: 'technicalBidOpeningTime', width: '' },
                { type: 'datetime', label: '商务开标', prop: 'businessOpeningTime', width: '' },
            ]
        }
    },
    created () {

    },
    methods: {
        handleConfirm () {
            this.$refs.refForm.validate((valid) => {
                if (valid) {
                    this.$confirm('确认保存吗?', '提示', {
                        confirmButtonText: '确定',
                        cancelButtonText: '取消',
                        type: 'warning'
                    }).then(() => {
                        console.log('dialogSetTime', this.formData)
                        this.$emit('confirm', this.formData)
                        this.dialogVisible = false
                    }).catch(() => {
                        this.$message({
                            type: 'info',
                            message: '已取消'
                        })
                    })
                }
            })
        }
    }
}
